sys_variable_value.value:
(function execute(inputs, outputs) {
  	outputs.ws1integration = false;

  	var rec = new GlideRecord('sys_properties');
  	rec.addQuery('name', 'x_vmw_ws1uem.WS1UEMCMDBIntegration');
	rec.query();
	if(rec.next()){
		outputs.ws1integration = rec.value;
	}
})(inputs, outputs);

